import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Hello React</h1>
        <p style={{

        justifyContent: 'center',

      }}>is simply dummy text of the printing and <br></br>typesetting industry. Lorem Ipsum has been the industry's <br></br>standard dummy text ever since the 1500s,<br></br> when an unknown printer took a galley of type and scrambled it to make a type <br></br>specimen book. It has survived not only five centuries, but also the leap into electronic typesetting,<br></br> remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets <br></br>containing Lorem Ipsum passages,</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
